import React from 'react';

const UserList = ({ users }) => {
  if (!users) {
    <h1>Loading users...</h1>
  }

  return (
    <ul>
      {users.map(user => {
        return (
          <li key={user.id} user={user}>{user.username}</li>
        );
      })}
    </ul>
  )
}

export default UserList;
